/** 
 * Returns the current  {@link ProgressState} and updates {@code progressHolder} with the currentprogress if it is  {@link #PROGRESS_STATE_AVAILABLE available}. <p>After a transformation  {@link Listener#onTransformationCompleted(MediaItem) completes}, this method returns  {@link #PROGRESS_STATE_NO_TRANSFORMATION}.
 * @param progressHolder A {@link ProgressHolder}, updated to hold the percentage progress if {@link #PROGRESS_STATE_AVAILABLE available}.
 * @return The {@link ProgressState}.
 * @throws IllegalStateException If this method is called from the wrong thread.
 */
@ProgressState public int getProgress(ProgressHolder progressHolder){
  verifyApplicationThread();
  if (progressState == PROGRESS_STATE_AVAILABLE) {
    Player player=checkNotNull(this.player);
    long durationMs=player.getDuration();
    long positionMs=player.getCurrentPosition();
    progressHolder.progress=min((int)(positionMs * 100 / durationMs),99);
  }
  return progressState;
}

